import React from 'react'
import Carousel from '@brainhubeu/react-carousel';
import '@brainhubeu/react-carousel/lib/style.css';
import Slides from "./Slides";
import "./Slider.css";

export const Slider = () => {
    return (
        <div className="carousel-container">
            <div className="carousel-title">
                <h2>My Projects</h2>
            </div>
                <Carousel
                        plugins={[
                    'arrows',
                    'infinite'
                ]}
                >
                <img src="https://cdn.pixabay.com/photo/2016/03/27/18/54/technology-1283624_960_720.jpg" />
                <img src="https://cdn.pixabay.com/photo/2017/07/31/11/31/laptop-2557468_960_720.jpg"/>
                <img src="https://cdn.pixabay.com/photo/2017/06/26/08/13/mockup-2443050_960_720.jpg" />
                </Carousel>  

                    
        </div>
    );
};

export default Slider;
